import React from 'react'

import MatchPage from './match';
import Landnav from '../landpage/landnav';

function Match() {
  return (
    <>
        <div className='matchnav'>
            <Landnav/>
        </div>
        <div className='matchprof'>
            <MatchPage/>
        </div>
    </>
  )
}

export default Match;
